    Refuge accomplishments from September through December of 1949. The report begins
    by summarizing the weather conditions during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
    and raptors- is also covered. The Refuge development and maintenance section discusses
    physical developments. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, hunting, and violations. N-R forms
